import ตอบสนอง from 'react-but-thai'

const แอป = () => {
    let [เคาน์เตอร์, เซ็ตเคาน์เตอร์] = ตอบสนอง.ใช้สถานะ(0)

    return (
        <button onClick={() => เซ็ตเคาน์เตอร์(เคาน์เตอร์ + 1)}>
            {เคาน์เตอร์}
        </button>
    )
}

export default แอป
